import React from 'react';
import './header.scss';
import Logo from '../../Assets/Logo/Logo-brainflix.jsx'

const Header = () => {
    return (
        <header>
            <img 
                className = "logo"
                src = {Logo}
                alt = "Brainflix Logo"
            ></img>
        </header>
    );
}

export default Header;
